import React, { useState, useEffect } from 'react';
import {
  Timeline,
  TimelineItem,
  TimelineSeparator,
  TimelineConnector,
  TimelineContent,
  TimelineOppositeContent,
} from '@mui/lab';
import Typography from '@mui/material/Typography';

import untitled from './image/Untitled.png';
import MosGames from './image/Mo\'s Games logo.png';
import mohammedGithub from './image/Mohammed_github.png';
import Nodejs from './image/node.png';
import theresidentsclub from './image/theresidentsclub.png';
import clearear from './image/Clearear.jpg';
import Javascript from './image/javascript.png';
import react from './image/React.png';
import Python from './image/python.png';
import SQL from './image/sql-logo.png';
import kotlin from './image/kotlin.png';
import selenium from './image/Selenium.png';
import renuem from './image/Renuem.png';
import './Aboutme.css'; // Using CSS for cleaner styling

const MainContent = () => {
  const [isMobileView, setIsMobileView] = useState(false);
  const [tooltipVisible, setTooltipVisible] = useState({});

  useEffect(() => {
    const updateView = () => setIsMobileView(window.innerWidth <= 1050);
    updateView();
    window.addEventListener('resize', updateView);
    return () => window.removeEventListener('resize', updateView);
  }, []);

  const handleLogoHover = (id) => {
    setTooltipVisible({ ...tooltipVisible, [id]: true });
  };

  const handleLogoLeave = (id) => {
    setTooltipVisible({ ...tooltipVisible, [id]: false });
  };

  const techLanguages = [
    { id: 'javascript', src: Javascript, name: 'Javascript' },
    { id: 'react', src: react, name: 'React.js' },
    { id: 'Node.js', src: Nodejs, name: 'Node.js' },
    { id: 'python', src: Python, name: 'Python' },
    { id: 'SQL', src: SQL, name: 'SQL' },
    { id: 'kotlin', src: kotlin, name: 'Kotlin' },
    { id: 'selenium', src: selenium, name: 'Selenium' },
  ];

  const workHistory = [
    {
      id: '2024-present',
      icon: renuem,
      title: 'üåç Renuem',
      description: (
        <>
          <p>Renewable energy investment platform.</p>
          <ul>
            <li>
              Developed a renewable energy investment app using React Native (Expo) and Node.js with Express.js.
            </li>
            <li>
              Deployed the backend on AWS, integrating MySQL RDS for efficient data management.
            </li>
            <li>
              Collaborated with stakeholders to align the app with business goals.
            </li>
          </ul>
        </>
      ),
    },
    {
      id: '2024',
      icon: clearear,
      title: 'üíº Clear Ear',
      description: (
        <>
          <p>Hearing clinic appointment management app.</p>
          <ul>
            <li>
              Designed and developed an Android app using React Native.
            </li>
            <li>
              Integrated a local database with AsyncStorage to store and track customer details.
            </li>
            <li>
              Worked closely with clinic staff to ensure operational efficiency.
            </li>
          </ul>
        </>
      ),
    },
    {
      id: '2020-2023',
      icon: MosGames,
      title: 'üéÆ Mo‚Äôs Pvt',
      description: (
        <>
          <p>Data analysis and digital development.</p>
          <ul>
            <li>
              Conducted data analysis for the launch of bubble tea in Pakistan.
            </li>
            <li>
              Analyzed market trends for new location expansions.
            </li>
            <li>
              Developed and maintained Mo‚Äôs Games website.
            </li>
            <li>
              Optimized marketing strategies, driving product launches.
            </li>
          </ul>
        </>
      ),
    },
  ];

  return (
    <div className="main-content">
      <div className="hero-section">
        <img src={untitled} alt="Mohammed" className="hero-image" />
        <div className="hero-text">
          <p>
            With over 7 years of experience as a Full Stack Developer and Data Analyst...
          </p>
          <p>
            I‚Äôve also been fortunate to combine my technical skills with entrepreneurial insight...
          </p>
          <p>
            Outside of work, I‚Äôm always exploring the latest in technology...
          </p>
          <p>
            If you‚Äôre interested in learning more about my projects or discussing collaboration opportunities...
          </p>
        </div>
      </div>

      <h3 className="section-header">Tech Languages</h3>
      <div className="logo-container">
        {techLanguages.map(({ id, src, name }) => (
          <div key={id} className="logo-item">
            <img
              src={src}
              alt={name}
              className="tech-logo"
              onMouseEnter={() => handleLogoHover(id)}
              onMouseLeave={() => handleLogoLeave(id)}
            />
            {tooltipVisible[id] && <div className="tooltip">{name}</div>}
          </div>
        ))}
      </div>

      <h3 className="section-header">Work History</h3>
      <Timeline>
        {workHistory.map(({ id, icon, title, description }) => (
          <TimelineItem key={id}>
            <TimelineOppositeContent>
              <img src={icon} alt={title} className="timeline-icon" />
            </TimelineOppositeContent>
            <TimelineSeparator>
              <TimelineConnector />
            </TimelineSeparator>
            <TimelineContent>
              <Typography variant="h6" className="timeline-title">
                {title}
              </Typography>
              {description}
            </TimelineContent>
          </TimelineItem>
        ))}
      </Timeline>
    </div>
  );
};

export default MainContent;
